import { Button, Link } from "@mui/material";

import "./header.css";

export default function Header() {
  return (
    <div className="header">
      <div className="title">MyBlogWebsite</div>
      <div className="actions">
        <Link to={"/about"}>About</Link>
        <Link to={"/contact"}>Contact</Link>
      </div>
    </div>
  );
}
